import React,{useState,useEffect} from "react";
import axios from "axios";
import { Fab } from "@material-ui/core";
import AddIcon from '@material-ui/icons/Add'
import './style.css';
import { makeStyles } from "@material-ui/styles";

const fabStyle = {
  position: 'absolute',
  bottom: 16,
  right: 16,
};


function App() {


  const [persons, setPersons] = useState([]);
  const getData = () => {
  axios.get("https://gorest.co.in/public/v1/users", {
    headers: {
      "Content-Type": "application/json",
      "Authorization": "Bearer bc1e0809f9bb5ce03125ea49290ec9c8acc225870ebd21e484217e79b88800db"
    }
  })
  .then(response => setPersons(response.data.data))
}

  useEffect(() => {
    getData()

    }, []);



  return (
    <div>

    <table className="table table-striped">
    <thead>
            <tr>
              <th> ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Gender</th>
              <th>Status</th> 
            </tr>
        </thead>

          <tbody>

        {(persons).map((person) => {
          return(
                <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
                <td>{person.gender}</td>
                <td>{person.status}</td>
                </tr>)
              })}
        </tbody>
        <Fab color="primary" aria-label="add" size="large" sx={fabStyle}>
          <AddIcon fontSize="large"/>
</Fab>
      </table>

      </div>
  );

}

export default App;
